description:
This is a story where everyone I know has been reborn, but I am the only one who has not been reborn.

After waking up, Wang Wenwen felt that the men around her became a little strange. 

The neighbor brother looked guilty and had love in his eyes; 

The domineering boy at the same table aggressively pursued her, flirted with her and hated the neighbor brother; 

The senior gentleman said softly that he would tutor her; 

Then there was this unknown president who said that she must marry him after she is twenty! 

hmmmm? 

But she had a normal relationship with them before. Don't they all have a mental illness?>
